import React, { Component } from "react";
import "./cssfiles/container.css";
import "./cssfiles/card.css";
import "../components/cssfiles/search.css";
import Card from "./card.js";

function container({ header, image, blurb, link, metalink }) {
  return (
    <div id="cardcontainer">
      <div id="card">
        <div className="col s12 m7 waves-effect " id="maincard">
          <h2 className="header">{header}</h2>
          <div className="card horizontal">
            <div className="card-image">
              <img src={image} alt="imglogo" />
            </div>
            <div className="card-stacked">
              <div className="card-content">
                <p>{blurb}</p>
              </div>
              <div className="card-action">
                <a href={metalink}>{link}</a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default container;
